import React from 'react';
import { Chart } from 'react-google-charts';

const chartData = [  ['Water Content', '4.75mm-2mm', '2mm-425μ', '475μ-75μ'],
  [0, 0.99, 0.98, 1.13],
  [2, 1, 0.97, 1.14],
  [4, 1.02, 0.98, 1.11],
  [6, 0.93, 0.93, 1.02],
  [8, 0.99, 0.98, 1.09],
  [12, 0.96, 0.96, 1.06],
  [14, 0.93, 0.96, 1.05],
  [16, 0.92, 0.94, 1.05]
];

const chartOptions = {
  title: 'Compaction Test Result of Ferro Manganese Slag',
  curveType: 'function',
  legend: { position: 'bottom' },
  hAxis: {
    title: 'Water Content (%)',
  },
  vAxis: {
    title: 'Density (g/cm3)',
  },
  pointSize: 6,
  dataOpacity: 0.5,
};

const MyChart = () => {
  return (
    <Chart
      chartType="LineChart"
      data={chartData}
      options={chartOptions}
      width="100%"
      height="400px"
    />
  );
};

export default MyChart;
